import React from 'react';
import ava1 from '../assets/img/ava1.jpg'; 
import ava2 from '../assets/img/ava2.jpg'; 
import ava3 from '../assets/img/ava3.jpg'; 
import blog1 from '../assets/img/blog1.jpg'; 
import blog2 from '../assets/img/blog2.jpg'; 

const MenuBox = () => {
  return (
    // <div className='menu_box'>
    //   <img src={ava1} alt='Avatar 1' />
    //   <img src={ava2} alt='Avatar 2' />
    //   <img src={ava3} alt='Avatar 3' />
    //   <img src={blog1} alt='Avatar 4' />
    //   <img src={blog2} alt='Avatar 5' />
    // </div>
    <div class = 'menu_box'>
        <nav>
            <svg></svg>
            <div class = 'pagination'>
                <div class = 'slide-numbers'>1</div>
                <div class = 'slide-numbers'>2</div>
                <div class = 'slide-numbers'>3</div>
                <div class = 'slide-numbers'>4</div>
            </div>
        </nav>
        <div class = 'slider'>
            <div class = 'slide indicator'>
                <img src={ava1} alt='Avatar 1' />
                <img src={ava2} alt='Avatar 2' />
                <img src={ava3} alt='Avatar 3' />
                <img src={blog1} alt='Avatar 4' />
                <div class="details desc">
                    <h2>Yosemite National Park</h2>
                    <p>Mô tả chi tiết về Yosemite</p>
                </div>   
            </div>
        </div>
    </div>
  );
};

export default MenuBox;
